func TestGetCfbm(t *testing.T) {
	unflag := "SX7Z6w57deFOcq6EgWCXdDJg5u.LAaVRZmjUIGkaUyI-1686370565-0-AV7inSvrGheK4iwLLsTn74u43Fpv+RJFWDe0GzYR3LiViXXoG3r8SqOPF14hOvlKNQ=="

	brFp, err := fpclient.LoadFingerprint(&fpclient.LoadingConfig{
		FilePath: "../../assets/input/chrome.json",
	})

	if err != nil {
		panic(err)
	}

	type args struct {
		brFp  *fpclient.Fingerprint
		proxy string
	}
	tests := []struct {
		name    string
		args    args
		want    string
		wantErr bool
	}{
		// TODO: Add test cases.
		{
			args: args{
				brFp:  brFp,
				proxy: "",
			},
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			got, err := GetCfbm(tt.args.brFp, tt.args.proxy)
			if (err != nil) != tt.wantErr {
				t.Errorf("GetCfbm() error = %v, wantErr %v", err, tt.wantErr)
				return
			}

			fmt.Printf("[ðŸ”‘] Cookie: %s\n", got)

			if len(got) != len(unflag) {
				t.Errorf("GetCfbm() error = %v, len = %d, wantlen = %d", fmt.Errorf("cookie length bad"), len(got), len(unflag))
				return
			}

			fmt.Println("[âœ…] Unflag")
		})
	}
}

